.xdebug-error {
  margin: 0 auto !important;
  border-color: #777 !important;
  border-collapse: collapse !important;
  font-size: 13px !important;
  font-family: Helvetica Neue, Arial !important;
}

.xdebug-error tr {
  line-height: 20px !important;
  border-color: #aaa !important;
}

.xdebug-error a {
  color: #d94a39 !important;
}

.xdebug-error a:hover {
  text-decoration: none !important;
}

.xdebug-error th span[style$="font-size: x-large;"] {
  display: none !important;
}

/* Error header */
.xdebug-error th[bgcolor="#f57900"] {
  padding: 3px 100px 3px 10px !important;
  color: #fff !important;
  text-shadow: 1px 1px #b42919 !important;
  background-color: #d94a39 !important;
}

.xdebug-error th[bgcolor="#f57900"] i {
  font-size: 13px !important;
  font-style: normal !important;
  text-shadow: 1px 1px #6e0d02 !important;
  background-color: #b52a1a !important;
  padding: 0 4px !important;
  border-radius: 3px !important;
}

/* Call stack */
.xdebug-error tr:nth-child(2) th {
  display: none; /* temporary */
  text-transform: uppercase !important;
  background-color: #d1d1d1 !important;
  text-shadow: 1px 1px #f1f1f1 !important;
}

.xdebug-error tr:nth-child(3) th {
  text-align: center !important;
  text-transform: uppercase !important;
  background-color: #d1d1d1 !important;
}

.xdebug-error tr td, /* TEMP */
.xdebug-error tr:nth-child(3) th,
.xdebug-error tr:nth-child(4) td,
.xdebug-error tr:nth-child(5) td,
.xdebug-error tr:nth-child(6) td,
.xdebug-error tr:nth-child(7) td,
.xdebug-error tr:nth-child(8) td,
.xdebug-error tr:nth-child(9) td {
  padding-left: 3px !important;
  font-size: 12px !important;
  font-family: Consolas, "Lucida Console", "Bitstream Vera Sans Mono" !important;
}

.xdebug-error font[color="#00bb00"],
.xdebug-error td[bgcolor="#eeeeec"] * {
  color: #222 !important;
  font-weight: bold !important;
  font-size: 12px !important;
  font-family: Consolas, "Lucida Console", "Bitstream Vera Sans Mono" !important;
}

.xdebug-error th[bgcolor="#eeeeec"] {
  background-color: #f1f1f1 !important;
}

.xdebug-error th[bgcolor="#e9b96e"] {
  background: #D94A39 !important;
  color: #FFFFFF !important;
  text-shadow: 1px 1px #B42919 !important;
}

.xdebug-error th {
  font-weight: bold !important;
  padding: 3px 10px;
}

/* Misc */
.runTitle,
#box-table-a th,
#box-table-a td,
.xdebug-var-dump {
  font-size: 13px !important;
  font-family: Consolas, "Lucida Console", "Bitstream Vera Sans Mono" !important;
}

